import '../styles/TrainerCard.css'



const TrainerCard = (props) => {

    const { id, name, academy, courses} = props.trainer
   

    return (
        <div className="trainerCard">
                <h2>{name}</h2>
            <div className="trainerDetails">
                <span> {academy.name}</span> <br />
                {courses.map(course=>{
                    return(
                        <span key="course.name"> Course: {course.name}</span>
                    );
                })}
            
            </div>

        </div>

    )
}


export default TrainerCard
